import React from 'react';

function UserOrderDetails({order}){

    const items = order.order_items.map((item) => 
    <tr>
        <td>
            {item.menu_item.name}
        </td>
        <td>
            {item.quantity}
        </td>
        <td>
            {item.price}
        </td>
    </tr>


    )
    return(
        <div className="order-box">
            <h4>{order.created_at}</h4>
            <h5>Total: ${order.total}</h5>
            <table>
                <tbody>
                    {items}
                </tbody>
            </table>
        </div>
    )
}


export default UserOrderDetails;
